import srcNav from '../data/nav-data.js'


function Nav(){
    const ListeNav = srcNav.map((element) => 
        {element.UserElement ? 
            <a href='' key={element.name.toString()}><img src={element.src}/></a> 
            :
            <img key={element.name.toString()} src={element.src}/> 
        }
    )

    return (
        <div className="content-nav">
            <div className="nav">{ListeNav}</div>
        </div>
    )
}

export default Nav
